window.bookSummaryJSON = "<p>Blast off to adventure!</p> <p>When Satou Takahiro is swept away from his ordinary life into the world of his favorite video game, a universe of space battles, interstellar colonies, and danger in the vastness of outer space awaits. </p> <p>Soon, he's living as \"Hiro\" the mercenary, with a tricked-out spaceship and a babe on each arm! There are space pirates to fight, girls to rescue, and trouble to get into (and hopefully out of). Hiro is going to live his new life to the fullest!</p>"; 
